import React, { useState, useRef } from "react";
import { Link, useNavigate } from "react-router-dom";
import Button from "react-bootstrap/Button";
import auth from "../service/auth-service";
import Form from "react-bootstrap/Form";
import image1 from "../assets/image1.jpeg";

const Adminlogin = () => {
  const [username, setUserName] = useState("");
  const [password, setPass] = useState("");
  const navigate = useNavigate();
  const Regi = (e) => {
    e.preventDefault();

    const val = {
      username,
      password,
    };

    auth
      .auth(val)
      .then((response) => {
        console.log("Feedback added successfully", response.data);
        localStorage.setItem("jwt", response.data.jwt);
        localStorage.setItem("username", val.username);

        window.location.href = "/Adminprofile";
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };

  return (
    <div className="Homeregister">
      <div class="container d-flex justify-content-center">
        <div class="row my-2 mx-2">
          <div class="col-md-12">
            <form>
              <div class="form-group pt-2 pl-1">
                <label for="exampleInputName">Your UserName</label>
                <input
                  type="text"
                  class="form-control"
                  id="exampleInputName"
                  value={username}
                  onChange={(e) => setUserName(e.target.value)}
                />
              </div>

              <div class="form-group pl-1">
                <label for="password">password</label>
                <input
                  type="password"
                  class="form-control"
                  id="exampleInputPassword"
                  value={password}
                  onChange={(e) => setPass(e.target.value)}
                />
              </div>

              <div class="row homecontactbtn">
                <div class="col-md-3 offset-md-9">
                  <button
                    class="btn btn-primary homecontactbtn1"
                    style={{
                      marginTop: "3rem",
                      fontFamily: "serif",
                      paddingTop: "10px",
                      width: "8rem",
                      alignItems: "center",
                      marginLeft: "120px",
                      fontSize: "20px",
                    }}
                    onClick={(e) => {
                      Regi(e);
                    }}
                  >
                    Login
                  </button>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Adminlogin;
